INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES ("2030/12/17 14:59:59", 2, 2, 24001, 0.0, 401, 10046, 0.0, "2020/07/31 12:00:00", "アヤネ", 24, 0.0, "やったね、ぷうきち！\nこれならお兄ちゃんたちの\nお手本になれたよね！", 102301);
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES ("2030/12/17 14:59:59", 1, 2, 24002, 0.0, 402, 10046, 2.21, "2020/07/31 12:00:00", "アヤネ", 24, 0.0, "私たちの勝ちだね！\nぷうきちと一緒なら\nどんなボールでも\nホームランを打ってみせるよ！", 102301);
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES ("2030/12/17 14:59:59", 2, 2, 24003, 0.0, 403, 10046, 0.0, "2020/07/31 12:00:00", "アヤネ", 24, 0.0, "やったやったぁ！\nお兄ちゃん、見ててくれた？\n私、すっごくがんばったよ！", 102301);
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES ("2030/12/17 14:59:59", 2, 1, 24004, 0.0, 701, 10046, 1.99, "2020/07/31 12:00:00", "アサヒ", 24, 0.0, "特訓の成果が出たみたいだ！\nもっと練習を重ねて\nこの調子で上達していこう！", 192201);
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES ("2030/12/17 14:59:59", 1, 2, 24005, 0.0, 702, 10046, 2.21, "2020/07/31 12:00:00", "アサヒ", 24, 0.0, "よし、いい感じだ！\nキャプテンとしての仕事は\nきっちり果たせそうだよ", 192201);
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES ("2030/12/17 14:59:59", 2, 1, 24006, 0.0, 703, 10046, 3.33, "2020/07/31 12:00:00", "アサヒ", 24, 0.0, "試合に向けて\nいい感覚を掴めた気がするよ！\nこのまま一気に全国大会だ！", 192201);
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES ("2030/12/17 14:59:59", 2, 2, 24007, 0.0, 801, 10046, 0.0, "2020/07/31 12:00:00", "部員３", 24, 0.0, "このくらい余裕だ\nオレたちは全国大会を\n目指してるんだからな", 192301);
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES ("2030/12/17 14:59:59", 1, 2, 24008, 0.0, 802, 10046, 2.68, "2020/07/31 12:00:00", "部員３", 24, 0.0, "オレだって\nビーチベースボール選手だ\nどんな球だろうが\n全部スタンドまで飛ばしてやる", 192301);
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES ("2030/12/17 14:59:59", 2, 2, 24009, 0.0, 803, 10046, 0.0, "2020/07/31 12:00:00", "部員３", 24, 0.0, "いい感じだ\nこれなら試合でも活躍できそうだ\n大暴れしてやる！", 192301);
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES ("2030/12/17 14:59:59", 1, 1, 24010, 0.0, 501, 10046, 0.0, "2020/07/31 12:00:00", "", 24, 0.0, "やった！", 192501);
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES ("2030/12/17 14:59:59", 1, 1, 24011, 0.0, 502, 10046, 0.0, "2020/07/31 12:00:00", "", 24, 0.0, "勝ったよ！", 192501);
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES ("2030/12/17 14:59:59", 1, 1, 24012, 0.0, 503, 10046, 0.0, "2020/07/31 12:00:00", "", 24, 0.0, "いい調子！", 192501);
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES ("2030/12/17 14:59:59", 6, 2, 24013, 0.0, 111, 10046, 5.33, "2020/07/31 12:00:00", "ミサト", 24, 0.0, "あら～…もしかして\n勝っちゃったのかしら？\nみんなの練習を見ていたから\nかもしれないわね", 113501);
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES ("2030/12/17 14:59:59", 1, 2, 24014, 0.0, 112, 10046, 6.85, "2020/07/31 12:00:00", "ミサト", 24, 0.0, "みんなの力になりたくて\n先生も頑張ってみました～！\nうまく投げられたみたいで\nよかったわ～！", 113501);
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES ("2030/12/17 14:59:59", 1, 2, 24015, 0.0, 113, 10046, 3.0, "2020/07/31 12:00:00", "ミサト", 24, 0.0, "練習お疲れさま～！\n先生も協力できて\nとってもうれしいわ～♪\n次も頑張りましょうね～！", 113501);
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES ("2030/12/17 14:59:59", 1, 2, 24016, 0.0, 611, 10046, 6.11, "2020/07/31 12:00:00", "ダイチ", 24, 0.0, "まだ練習が足りねえみてえだな\nこれっぽっちも本気で\n投げてねえっつーの\nもう一回やんぞ！", 192401);
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES ("2030/12/17 14:59:59", 1, 2, 24017, 0.0, 612, 10046, 6.75, "2020/07/31 12:00:00", "ダイチ", 24, 0.0, "ふん、当然の結果だな\n俺の球は、誰にも打てねえよ！\nまたやりてえっつーなら\nとことん付き合ってやるぜ！", 192401);
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES ("2030/12/17 14:59:59", 2, 2, 24018, 0.0, 613, 10046, 0.0, "2020/07/31 12:00:00", "ダイチ", 24, 0.0, "おっしゃあ！\nこの勢いで全国に行ってやるぜ！\n全員三振で仕留めてやる！", 192401);
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES ("2030/12/17 14:59:59", 2, 1, 24019, 0.0, 211, 10046, 4.52, "2020/07/31 12:00:00", "ハツネ", 24, 0.0, "きらーん☆\nハツネちゃんの大勝利なのだ～！\nみんながもっと上達できるように\n私もまだまだ頑張るからね！", 113401);
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES ("2030/12/17 14:59:59", 2, 1, 24020, 0.0, 212, 10046, 3.89, "2020/07/31 12:00:00", "ハツネ", 24, 0.0, "やったあ！　私の勝ちだね！\nチアリーダーもピッチャーも\nハツネちゃんに任せてよ！", 113401);
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES ("2030/12/17 14:59:59", 1, 2, 24021, 0.0, 213, 10046, 13.49, "2020/07/31 12:00:00", "ハツネ", 24, 0.0, "よお～し、この調子でもっと\n頑張ろう…と思ったけど\n超能力を使ったから…\n眠くなってきちゃった…すやぁ…", 113401);
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES ("2030/12/17 14:59:59", 1, 2, 24022, 0.0, 311, 10046, 3.17, "2020/07/31 12:00:00", "カヤ", 24, 0.0, "いい勝負だったぜ！\nたぎっちまって\nつい本気で投げちまったよ", 106501);
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES ("2030/12/17 14:59:59", 1, 2, 24023, 0.0, 312, 10046, 4.42, "2020/07/31 12:00:00", "カヤ", 24, 0.0, "どうだ？\nオレ様のボールは熱かっただろ！\nま、でもおまえらの根性も\nなかなかのもんだったぜ", 106501);
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES ("2030/12/17 14:59:59", 6, 1, 24024, 0.0, 313, 10046, 2.89, "2020/07/31 12:00:00", "カヤ", 24, 0.0, "なんだよ、そんなもんか？\nこっちはまだまだ投げたりねえ\nもっと勝負しようぜ！", 106501);
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES ("2030/12/17 14:59:59", 4, 3, 24025, 0.0, 421, 10046, 3.71, "2020/07/31 12:00:00", "アヤネ", 24, 0.0, "あとちょっとだったのに～！\n次こそぷうきちと一緒に\n勝ってみせるからね！", 102301);
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES ("2030/12/17 14:59:59", 2, 1, 24026, 0.0, 721, 10046, 5.1, "2020/07/31 12:00:00", "アサヒ", 24, 0.0, "いい勝負だったね！\nでも、やっぱり悔しいな…\nもっと練習して\n今度は絶対に俺が勝つから！", 192201);
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES ("2030/12/17 14:59:59", 1, 3, 24027, 0.0, 821, 10046, 4.34, "2020/07/31 12:00:00", "部員３", 24, 0.0, "ちっ…あと一歩足りなかったか\n次こそは絶対に勝つから\nそのつもりでいろ", 192301);
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES ("2030/12/17 14:59:59", 1, 1, 24028, 0.0, 521, 10046, 0.0, "2020/07/31 12:00:00", "", 24, 0.0, "いい勝負だったよ\nまたやろうね", 192501);
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES ("2030/12/17 14:59:59", 1, 2, 24029, -360.0, 101, 10046, 5.62, "2020/07/31 12:00:00", "ミサト", 24, 0.0, "とってもよくできました～♪\n頑張ってくれて先生うれしいわ\nこれからも試合に向けて\n練習していきましょうね～", 113501);
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES ("2030/12/17 14:59:59", 1, 2, 24030, -360.0, 102, 10046, 9.58, "2020/07/31 12:00:00", "ミサト", 24, 0.0, "頑張った成果ね～！\nこのまま練習を続ければ\nもっとすごい成績を残せそうよ\n期待してますからね～！", 113501);
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES ("2030/12/17 14:59:59", 2, 2, 24031, -360.0, 103, 10046, 0.0, "2020/07/31 12:00:00", "ミサト", 24, 0.0, "いい子、いい子～♪\n頑張り屋さんのあなたを\nたっくさん褒めてあげますからね", 113501);
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES ("2030/12/17 14:59:59", 2, 1, 24032, -360.0, 104, 10046, 9.13, "2020/07/31 12:00:00", "ミサト", 24, 0.0, "夢に向けて、一歩前進できたわね\nこの調子で、夢を叶えましょう\n目指せ、全国大会～！", 113501);
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES ("2030/12/17 14:59:59", 1, 2, 24033, -360.0, 105, 10046, 8.27, "2020/07/31 12:00:00", "ミサト", 24, 0.0, "絶好調ね～♪\nきっと試合でも大活躍\n間違いなしだわ\n楽しみにしていますからね～！", 113501);
